sys_variable_value.value:
(function execute(inputs, outputs) {
  if(inputs.role == 'author'){
 	var usersid = JSON.parse(inputs.response)["RequestedObject"]["FieldContents"]["10084"]["Value"];
}else if (inputs.role == 'owner'){
  	var usersid = JSON.parse(inputs.response)["RequestedObject"]["FieldContents"]["10866"]["Value"];
}else if (inputs.role == 'custodian'){
  	var usersid = JSON.parse(inputs.response)["RequestedObject"]["FieldContents"]["13338"]["Value"];
}
outputs.usersid = usersid;
})(inputs, outputs);

